import '../Style/Video.css'

export default function Video(props) {
    return (<>
        <div className="videoContainer">
            {props.src === "external" ? <iframe className='video' title={props.title} src={props.src} controls preload='auto' frameborder="0"></iframe> : null}
        </div>
    </>)
}
